/// url : "https://cdemy.ihashem.site/public/cdemy/assets/36qq90pxyv0gsokc?key=directus-small-crop"
/// relative_url : "/public/cdemy/assets/36qq90pxyv0gsokc?key=directus-small-crop"
/// dimension : "64x64"
/// width : 64
/// height : 64

class Thumbnails {
  Thumbnails({
      String? key, 
      String? url, 
      String? relativeUrl, 
      String? dimension, 
      int? width, 
      int? height,}){
    _key = key;
    _url = url;
    _relativeUrl = relativeUrl;
    _dimension = dimension;
    _width = width;
    _height = height;
}

  Thumbnails.fromJson(dynamic json) {
    _key = json['key'];
    _url = json['url'];
    _relativeUrl = json['relative_url'];
    _dimension = json['dimension'];
    _width = json['width'];
    _height = json['height'];
  }
  String? _key;
  String? _url;
  String? _relativeUrl;
  String? _dimension;
  int? _width;
  int? _height;

  String? get key => _key;
  String? get url => _url;
  String? get relativeUrl => _relativeUrl;
  String? get dimension => _dimension;
  int? get width => _width;
  int? get height => _height;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['key'] = _key;
    map['url'] = _url;
    map['relative_url'] = _relativeUrl;
    map['dimension'] = _dimension;
    map['width'] = _width;
    map['height'] = _height;
    return map;
  }

}